contracts/HemShop.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import '@openzeppelin/contracts/token/ERC721/ERC721.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/security/ReentrancyGuard.sol';
import '@openzeppelin/contracts/proxy/utils/UUPSUpgradeable.sol';
import '@openzeppelin/contracts/proxy/ERC1967/ERC1967Proxy.sol';

contract HemShop is ERC721, Ownable, ReentrancyGuard {
    address public userSellerManager;
    address public productManager;
    address public categoryManager;
    address public reviewManager;
    address public purchaseManager;

    // Function selectors for each manager
    bytes4 private constant REGISTER_SELLER = bytes4(keccak256("registerSeller(string,string,string,string,string)"));
    bytes4 private constant CREATE_PRODUCT = bytes4(keccak256("createProduct((string,string,uint256,uint256,string[],string[],string[],string,string,uint256,string,string,uint256))"));
    bytes4 private constant CREATE_CATEGORY = bytes4(keccak256("createCategory(string)"));
    bytes4 private constant CREATE_REVIEW = bytes4(keccak256("createReview(uint256,uint256,string)"));
    bytes4 private constant RECORD_PURCHASE = bytes4(keccak256("recordPurchase(uint256,address,address,uint256,uint256,(string,string,string,string,string,string,string,string),string,string,uint256)"));

    constructor(
        address _userSellerManager,
        address _productManager,
        address _categoryManager,
        address _reviewManager,
        address _purchaseManager
    ) ERC721('HemShop', 'Hsp') {
        userSellerManager = _userSellerManager;
        productManager = _productManager;
        categoryManager = _categoryManager;
        reviewManager = _reviewManager;
        purchaseManager = _purchaseManager;
    }

    // Delegate calls to respective managers
    fallback() external payable {
        address implementation;
        bytes4 selector = msg.sig;

        if (isUserSellerFunction(selector)) {
            implementation = userSellerManager;
        } else if (isProductFunction(selector)) {
            implementation = productManager;
        } else if (isCategoryFunction(selector)) {
            implementation = categoryManager;
        } else if (isReviewFunction(selector)) {
            implementation = reviewManager;
        } else if (isPurchaseFunction(selector)) {
            implementation = purchaseManager;
        } else {
            revert("Unknown function");
        }

        assembly {
            calldatacopy(0, 0, calldatasize())
            let result := delegatecall(gas(), implementation, 0, calldatasize(), 0, 0)
            returndatacopy(0, 0, returndatasize())
            switch result
            case 0 { revert(0, returndatasize()) }
            default { return(0, returndatasize()) }
        }
    }

    receive() external payable {}

    function isUserSellerFunction(bytes4 _selector) internal pure returns (bool) {
        return _selector == REGISTER_SELLER ||
               _selector == bytes4(keccak256("registerUser(string,string,string)")) ||
               _selector == bytes4(keccak256("getSellerProfile(address)")) ||
               _selector == bytes4(keccak256("getSellerStatus(address)"));
    }

    function isProductFunction(bytes4 _selector) internal pure returns (bool) {
        return _selector == CREATE_PRODUCT ||
               _selector == bytes4(keccak256("updateProduct(uint256,(string,string,uint256,uint256,string[],string[],string[],string,string,uint256,string,string,uint256))")) ||
               _selector == bytes4(keccak256("deleteProduct(uint256)")) ||
               _selector == bytes4(keccak256("getProduct(uint256)"));
    }

    function isCategoryFunction(bytes4 _selector) internal pure returns (bool) {
        return _selector == CREATE_CATEGORY ||
               _selector == bytes4(keccak256("createSubCategory(uint256,string)")) ||
               _selector == bytes4(keccak256("updateCategory(uint256,string,bool)")) ||
               _selector == bytes4(keccak256("getCategory(uint256)"));
    }

    function isReviewFunction(bytes4 _selector) internal pure returns (bool) {
        return _selector == CREATE_REVIEW ||
               _selector == bytes4(keccak256("deleteReview(uint256,uint256)")) ||
               _selector == bytes4(keccak256("getReviews(uint256)"));
    }

    function isPurchaseFunction(bytes4 _selector) internal pure returns (bool) {
        return _selector == RECORD_PURCHASE ||
               _selector == bytes4(keccak256("withdraw()")) ||
               _selector == bytes4(keccak256("markPurchaseDelivered(uint256,address)")) ||
               _selector == bytes4(keccak256("getSellerBalance(address)"));
    }
}

